Rust Playground has a REST API for us to send rust code to and get result back. Here is how it works in JavaScript. introduction/js/hello.js (async () => { const code = ` fn main () { println!("Hello, world!"); } `; const edition = "2018"; const version = "stable"; const optimize = "0"; const api = "https://play.rust-lang.org/evaluate.json"; const result = await (await fetch(api, { method: "POST", body: JSON.stringify({code, edition, version, optimize }) })).json(); console.log('From Rust Playground', {result}); document.getElementById('result').innerHTML = `From Rust Playground:
${JSON.stringify(result, null, 2)}.
Also see console log. `; })(); It is possible to build a whole interactive coding environment this way and we might want to do it in the future. However, mdBook already has this feature built in so we might just use it unless we need more custom features. introduction/hello/src/main.rs fn main() { println!("Hello, world!");
} The example above shows different levels of thinking in programming although they achieved similar goal, i.e., run rust code at the backend and display the result on the page. With the packaged solution, we get things done but don't know much about how it works. The implementation is hidden from us unless we take a look at the source code . The REST API solution is actually a hack by inspecting the network traffic of the packaged solution in the browser DevTools and figuring out the API by ourselves. This is the main difference between learning how to use a feature and how to implement a feature. This book is more about the latter.

